import * as SC from "./style";
import { Link } from "react-router-dom";

export const Home = () => {
  return (
    <div>
      <SC.StyledNavbar className="d-flex justify-content-end">
        <ul className="nav">
          <li className="nav-item">
            <Link to="/">
              <span className="nav-link">Home</span>
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/todo-app">
              <span className="nav-link">Todo App</span>
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/stories-app">
              <span className="nav-link">Hacker News Stories App</span>
            </Link>
          </li>
        </ul>
      </SC.StyledNavbar>

      <h1>My App</h1>
    </div>
  );
};

export default Home;
